import { Routes } from '@angular/router';
import { LoginComponent } from './login.component';

export const LoginRotas: Routes = [
  {
    path: '',
    component: LoginComponent,
    children: [
      {
        path: 'login/funcionario', component: LoginComponent, data: { tipoUsuario: 'funcionario' } },
  { path: 'login/coordenador', component: LoginComponent, data: { tipoUsuario: 'coordenador' } },
  { path: 'login/cpd', component: LoginComponent, data: { tipoUsuario: 'cpd' } },

    ],
  }
]
